  \"temperature-salinity-and-other-variables-collected-from-discrete-sample-and-profile-observatione3086\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0143397 includes discrete
  sample and profile data collected from FRANKLIN in the Indian Ocean from 1995-09-13
  to 1995-10-14 and retrieved during cruise FA9508 and WOCE_IR06_1995. These data
  include DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, Potential temperature (theta),
  SALINITY, WATER TEMPERATURE, phosphate and silicate. The instruments used to collect
  these data include CTD and bottle.nnThese data were collected by Susan Wijffels
  of Commonwealth Scientific and Industrial Research Organization as part of the WOCE_IR06_09FA19950913
  data set.nnThe World Ocean Circulation Experiment (WOCE) was a major component of
  the World Climate Research Program with the overall goal of better understanding
  the ocean's role in climate and climatic changes resulting from both natural and
  anthropogenic causes. The CO2 survey took advantage of the sampling opportunities
  provided by the WOCE Hydrographic Program (WHP) cruises during this period between
  1990 and 1998. The final collection covers approximately 23,000 stations from 94
  WOCE cruises.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
